import { useState } from "react";

function Card() {

    let [nutrients, setNutrients] = useState(['Omega-3', 'multivitimin'])

    return (
        <>
            {
                nutrients.map((data, i) => {
                    return (
                        <div class="p-4 w-80">
                            <div class="flex rounded-lg h-full bg-gray-100 p-8 flex-col">
                                <div class="flex items-center mb-3">
                                    <h2 class="text-gray-900 text-lg title-font font-medium">{data}</h2>
                                    <span className="absolute bg-indigo-500 rounded-full h-4 w-4  border-indigo-500 -ml-55px"></span>
                                </div>
                                <p className="mb-3 text-gray-500 text-sm">time</p>
                                <div>
                                    <p className="text-m text-gray-800">Blue bottle crucifix vinylBlue bottle crucifix vinylBlue bottle crucifix vinylBlue bottle crucifix vinylBlue bottle crucifix vinyl</p>
                                </div>
                            </div>
                        </div>
                    )
                })
            }
        </>
    )
}

export default Card;
